query:
mutation containerFqdnRemoveValues ( $fqdnContainerRemoveValuesInput:FqdnContainerRemoveValuesInput! ) {
	container ( ) {
		fqdn {
			removeValuesFqdnContainerMutations: removeValues ( input:$fqdnContainerRemoveValuesInput   ) {
				containerFqdnContainerRemoveValuesPayload: container {
					id
					name
					description
					size
					auditFqdnContainer: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}

			}
		}

	}	
}
